function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/home' exact component={Home} />
        <Route path='/Activities' component={Activities} />
        <Route path='/MyBooks' component={MyBooks} />
        <Route path='/Traveling' component={Traveling} />
        <Route path='*' component={NoPage} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
